import {
  Directive,
  HostBinding,
  Input,
  OnInit,
} from '@angular/core';
import { Observable, Subscription } from 'rxjs';
import { theme, Palette } from '../../../styles/theme';

export interface Classes {
  color?: Palette;
  fontWeight?: number;
  fontSize?: number;
  cursor?: string;
}

@Directive({
  selector: '[appClasses]',
})
export class ClassesDirective implements OnInit {
  private palette = theme.palette;
  private unsubscribe: Subscription;

  @Input() public classes: Classes = {
    color: 'text',
    cursor: 'initial',
    fontSize: 1.4,
    fontWeight: 500,
  };

  @Input() classes$: Observable<Classes>;

  @HostBinding('style.color') private color: string;
  @HostBinding('style.font-weight') private fontWeight: number;
  @HostBinding('style.font-size') private fontSize: string;
  @HostBinding('style.cursor') private cursor: string;
  @HostBinding('style.background-color') private backgroundColor: string;

  constructor() {}

  ngOnInit(): void {
    this.setStyle();
    this.subscribeToChange();
  }

  ngOnDestroy() {
    if (this.unsubscribe) {
      this.unsubscribe.unsubscribe();
    }
  }

  private setStyle() {
    this.fontWeight = this.classes.fontWeight;
    this.fontSize = `${this.classes.fontSize}rem`;
    this.color = this.palette[this.classes.color];
  }

  private subscribeToChange() {
    if (this.classes$) {
      this.unsubscribe = this.classes$.subscribe((classes) => {
        this.classes = classes;
        this.setStyle();
      });
    }
  }
}

import { Injectable } from '@angular/core';
import { ColumnModel } from '../table/models/column.model';

export interface ColumnsData<T> {
  columns: ColumnModel[];
  columnsDefs: (string| keyof T)[];
}

@Injectable({
  providedIn: 'root',
})
export class ColumnsService<T> {
  constructor() {}

  private setColumnDefsFromType(model: T): string[] {
    return Object.keys(model);
  }

  private filterColumnDefs(columnDefs: (string| keyof T)[], filters: [keyof T | string]): (string| keyof T)[] {
    return columnDefs.filter((item) => !filters.includes(item));
  }

  private setColumnDefs(model: T, filters: [keyof T | string]): (string| keyof T)[] {
    return this.filterColumnDefs(this.setColumnDefsFromType(model), filters);
  }

  private setColumnWithColumnDefs(
    columns: ColumnModel[],
    columnDefs:  (string| keyof T)[]
  ): ColumnModel[] {
    return columns.map((column, i) => {
      return new ColumnModel({
        ...column,
        columnDef: column.columnDef || columnDefs[i],
      });
    });
  }

  private setColumnDefsFromColumns(
    columns: ColumnModel[],
    columnDefs: (string| keyof T)[]
  ):  (string| keyof T)[] {
    if (columns.length > columnDefs.length) {
      columnDefs = columns.map((column) => column.columnDef);
    }
    return columnDefs;
  }

  private initColumnsDefs(model, filters):  (string| keyof T)[] {
    return this.setColumnDefs(model, filters);
  }

  private getColumnsDefs(columns: ColumnModel[], columnDefs: (string| keyof T)[]) {
    return this.setColumnDefsFromColumns(columns, columnDefs);
  }

  public getColumns(
    model: T,
    filters: (string| keyof T)[],
    tableColumns: ColumnModel[]
  ): ColumnsData<T> {
    const columnsDefs = this.initColumnsDefs(model, filters);
    const columns = this.setColumnWithColumnDefs(tableColumns, columnsDefs);

    return { columns, columnsDefs: this.getColumnsDefs(columns, columnsDefs) };
  }
}

import { RowModel } from './models/row.model';
import { DataSource } from '@angular/cdk/collections';
import { Observable, BehaviorSubject, Subject } from 'rxjs';
import { TableOptions } from './table.component';

export interface EditRow<T> {
  row: RowModel<T>;
  options?: any;
}

export class TableDataSource<T> {
  private rows: RowModel<T>[];
  private rows$: BehaviorSubject<RowModel<T>[]>;
  private data$: BehaviorSubject<T[]>;
  private row$: Subject<RowModel<T>>;
  private edit$: Subject<EditRow<T>>;

  constructor(public data: T[], public options?: TableOptions<T>) {
    this.data$ = new BehaviorSubject<T[]>(this.data);
    this.rows$ = new BehaviorSubject<RowModel<T>[]>(
      this.setDataAsRoW(this.data, this.options)
    );
    this.row$ = new Subject();
    this.edit$ = new Subject();
  }

  disconnect(): void {}

  private setDataAsRoW(data: T[], options?: TableOptions<T>): RowModel<T>[] {
    this.rows = data
      .map((item: T) => new RowModel({ item }))
      .map((row: RowModel<T>) => {
        if (
          options?.editable &&
          options?.editable.indexOf(row.item['id']) > -1
        ) {
          row.editable = true;
        }

        if (options?.pending && options?.pending.indexOf(row.item['id']) > -1) {
          row.pending = true;
        }

        return row;
      });

    return this.rows;
  }

  public load(data?: T[]): void {
    this.rows$.next(this.setDataAsRoW(data));
  }

  public loadRows(rows: RowModel<T>[]) {
    this.rows = rows;
    this.rows$.next(rows);
  }

  public connect(): Observable<T[]> {
    return this.data$.asObservable();
  }
  public connectToRows(): Observable<RowModel<T>[]> {
    return this.rows$.asObservable();
  }

  public getRow(): Observable<RowModel<T>> {
    return this.row$.asObservable();
  }

  public emitRow(row: RowModel<T>) {
    this.row$.next(row);
  }

  public connectEdit(): Observable<EditRow<T>> {
    return this.edit$.asObservable();
  }

  public emitEdit(edit: EditRow<T>) {
    this.edit$.next(edit);
  }

  public getRows() {
    return [...this.rows];
  }
}

